  \"2013-03-15T23:42:25.451755\",\n\t\"name\": \"aasg-geothermal-data-thermal-springs-feature-content-model\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This spreadsheet indicates the content
  requested for basic data characterizing a hot spring feature for the AASG geothermal
  data project. Typcially water temperatures are recorded with other information such
  as water quality or chemical analysis from a particular spring. The temperature
  and flow rate reported here are meant to be generalized characterization. Other
  observation services should be used to report time series of temperature or flow
  measurements; chemical analytical data is also reported by a separate observation
  service. This sheet may be used to compile multiple temperature or flow rate observations
  for individual springs as well. Spreadsheet is in zip archive. \",\n\t\"license_title\":
